import React, { Component, Fragment } from "react";

import "./style.css";

import SingleDropzone from "./SingleDropzone";

class App extends Component {
  render() {
    return (
      <Fragment>
        <div className="container">
          <div className="row">
            <div className="col s12">
              <SingleDropzone />
            </div>
          </div>
        </div>
      </Fragment>
    );
  }
}

export default App;
